@prefix tagteam: <http://tagteam.fandaws.org/ontology/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

tagteam:MedicalEvent a rdfs:Class ;
  rdfs:label "Medical Event" ;
  rdfs:comment "An event in a medical context" .

@prefix tagteam: <http://tagteam.fandaws.org/ontology/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

tagteam:TreatmentEvent a rdfs:Class ;
  rdfs:subClassOf tagteam:MedicalEvent ;
  rdfs:label "Treatment Event" .

@prefix tagteam: <http://tagteam.fandaws.org/ontology/> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .

tagteam:hasAgent a rdf:Property ;
  rdfs:label "has agent" ;
  rdfs:domain tagteam:Event ;
  rdfs:range tagteam:Agent .

@prefix tagteam: <http://tagteam.fandaws.org/ontology/> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .

tagteam:Autonomy a tagteam:EthicalValue ;
  rdfs:label "Autonomy" ;
  tagteam:domain "Dignity" ;
  tagteam:polarity "neutral" .

@prefix tagteam: <http://tagteam.fandaws.org/ontology/> .
@prefix bfo: <http://purl.obolibrary.org/obo/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

tagteam:Event rdfs:subClassOf bfo:BFO_0000003 ;
  rdfs:label "Event" .

@prefix tagteam: <http://tagteam.fandaws.org/ontology/> .
@prefix dc: <http://purl.org/dc/elements/1.1/> .

tagteam:ConsentEvent a rdfs:Class ;
  rdfs:label "Consent Event" ;
  dc:description "An event involving patient consent" ;
  dc:created "2026-02-10" .

@prefix tagteam: <http://tagteam.fandaws.org/ontology/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

tagteam:hasAgent a owl:ObjectProperty ;
  owl:inverseOf tagteam:isAgentOf .

@prefix tagteam: <http://tagteam.fandaws.org/ontology/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

tagteam:MedicalProfessional a owl:Class ;
  rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty tagteam:hasRole ;
    owl:someValuesFrom tagteam:ProfessionalRole
  ] .

@prefix tagteam: <http://tagteam.fandaws.org/ontology/> .

tagteam:BadClass a rdfs:Class
  rdfs:label "Missing semicolon" .
